            id: "3398157"
        },
        {
            name: "Miguelón",
            username: "@la_bomba_cosmica",
            id: "1607991476"
        }
    ]

    function setSelectedMemberId(id) {
        props.setSelectedMemberId(id)

        this.setState({}, () => {
            this.props.history.push({
              pathname: '/instagramroundtwo',
              state: {
                selectedMemberId: id
              }
            });
          })
    }

    return (
        <div>
            <p>Con el perfil de Instagram de qué miembro de La Pegatina quieres jugar?</p>
            {membersaccounts.map((memberaccount) =>
            <button onClick={() => setSelectedMemberId(memberaccount.id)}>{memberaccount.name}{memberaccount.username}</button>
            )}
        </div>
    )
}

export default members;
